import React, { useState } from 'react';
import axios from 'axios';

function SignUp() {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [painLocation, setPainLocation] = useState('knee');  // Default value is 'knee'
    const [painIntensity, setPainIntensity] = useState(0);  // Default value is 0

    const handleSubmit = async (event) => {
        event.preventDefault(); // Prevent the default form submit behavior

        // Preparing the data object to send to the server
        const userData = {
            username,
            password,
            painLocation,
            painIntensity
        };

        try {
            // Making a POST request to your server endpoint
            const response = await axios.post('http://localhost:5000/signup', userData);
            alert('Signup Successful'); // Alerting the user on successful registration
            console.log('Server Response:', response.data);
        } catch (error) {
            // Handling errors if the server response isn't successful
            alert('Signup Failed: ' + error.response.data);
            console.error('Signup Error:', error.response.data);
        }
    };

    return (
        <div>
            <h1>Sign Up</h1>
            <form onSubmit={handleSubmit}>
                <label>
                    Username:
                    <input
                        type="text"
                        value={username}
                        onChange={e => setUsername(e.target.value)}
                        required
                    />
                </label>
                <label>
                    Password:
                    <input
                        type="password"
                        value={password}
                        onChange={e => setPassword(e.target.value)}
                        required
                    />
                </label>
                <label>
                    Pain Location:
                    <select value={painLocation} onChange={e => setPainLocation(e.target.value)}>
                        <option value="knee">Knee</option>
                        <option value="shoulder">Shoulder</option>
                        <option value="back">Back</option>
                    </select>
                </label>
                <label>
                    Pain Intensity (0-10):
                    <input
                        type="number"
                        value={painIntensity}
                        onChange={e => setPainIntensity(parseInt(e.target.value, 10))}
                        min="0"
                        max="10"
                        required
                    />
                </label>
                <button type="submit">Sign Up</button>
            </form>
        </div>
    );
}

export default SignUp;
